import React from "react";
import { Container, Row, Col, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./landing.css";
import 'aos/dist/aos.css';
import AOS from 'aos';
import { useEffect } from 'react';
import ParallaxAirplane from "../Airplane/Airplane"
import planeGIF from "../assets/img/planegif.gif"


const Landing = () => {
    useEffect(() => {
        AOS.init();
      }, []);
    return(
        <div className="landing">
            <div className="herosection">
            <section id="hero" className="hero d-flex align-items-center">
      <Container>
        <Row>
          <ParallaxAirplane></ParallaxAirplane>
          {/* <img className="" src={planeGIF}/> */}
          <Col lg={6} className="d-flex flex-column justify-content-center">
            <h1 data-aos="fade-up">Want to earn during flying?</h1>
            <h2 data-aos="fade-up" data-aos-delay="400">
              "Unlocking Extra Luggage Space: Share, Travel, and Earn!"
            </h2>
            <div data-aos="fade-up" data-aos-delay="600">
              <div className="text-center text-lg-start">
                <Button 
                  variant="secondary" 
                  href="#about" 
                  className="scrollto d-inline-flex align-items-center justify-content-center align-self-center" 
                  data-bs-toggle="tooltip" 
                  data-bs-placement="bottom" 
                  title="Let's Get Started"
                >
                  <span>Get Started</span>
                  <i className="bi bi-arrow-right"></i>
                </Button>
              </div>
            </div>
          </Col>
          <Col lg={6} className="hero-img" data-aos="zoom-out" data-aos-delay="200">
            <img src=".\assets\img\HeroSection-LuggageImg.jpg" className="img-fluid" alt="" />
          </Col>
        </Row>
      </Container>
    </section>
    </div>        
    </div>
    );
};

export default Landing;
